import React from "react";
import { Return } from "../../svg";

export default function SearchMenu() {
  return (
    <div className="search_area">
      <div className="search_wrap">
        <div className="back_logo">
          <div className="circle">
            <Return />
          </div>
        </div>
        <div className="search"></div>
      </div>
    </div>
  );
}
